import { Link } from "react-router-dom";
import User from "./User";
import "./Nav.css";

function Nav() {
  return (
    <nav className='NavBar'>
      <ul>
        <li>
          <Link to='/'>Home</Link>
        </li>
        <li>
          <Link to='/add'>Add Question</Link>
        </li>
        <li>
          <Link to='/leaderboard'>Leaderboard</Link>
        </li>
        <div>
          <User />
        </div>
      </ul>
    </nav>
  );
}

export default Nav;
